ный", "0", 1, 0, 5, "Лопатка силиконовая / лопатка кухонная 27 см", "Osagarri"], "53": ["На ручке есть повреждения или отслоение, которое при прикосновении начинает сыпаться ", "2021-03-15T12:18:33Z", "голубой, прозрачный", "0", 2, 0, 1, "Лопатка силиконовая / лопатка кухонная 27 см", "Osagarri"], "58": ["Отличная лопатка,в меру мягкая.думала будет не очень удобная из за мощной ручки,оказалось наоборот.большая по размеру,в сравнении на фото.рекомендую ", "2021-03-12T07:33:23Z", "красный, прозрачный", "0", 2, 0, 5, "Лопатка силиконовая / лопатка кухонная 27 см", "Osagarri"], "59": ["Оличная. До этого была с другая, с прозрачной ручкой - быстро сломалась. Думаю эта прослужит долго.", "2021-03-11T13:07:26Z", "зеленый, прозрачный", "0", 2, 0, 5, "Лопатка силиконовая / лопатка кухонная 27 см", "Osagarri"], "65": ["Классная лопатка, отличного качества. Рекомендую.", "2021-03-07T15:17:41Z", "красный, прозрачный", "0", 1, 0, 5, "Лопатка силиконовая / лопатка кухонная 27 см", "Osagarri"], "66": ["Лопатка отличная. Достаточно тяжелая, длинная удобная ручка, плюс, что она цельная. Покупкой довольна.", "2021-03-06T11:17:49Z", "голубой, прозрачный", "0", 1, 0, 5, "Лопатка силиконовая / лопатка кухонная 27 см", "Osagarri"], "68": ["Хорошая лопатка, но следовало отшлифовать стыки, грубоваты.", "2021-03-04T12:40:52Z", "зеленый, прозрачный", "0", 1, 0, 4, "Лопатка силиконовая / лопатка кухонная 27 см", "Osagarri"], "70": ["Пролобдддрро", "2021-03-04T10:49:57Z", "красный, прозрачный", "0", 2, 1, 4, "Лопатка силиконовая / лопатка кухонная 27 см", "Osagarri"], "72": ["Лопатка супер!!! Большая, хорошей жёсткости, очень понравились. Цвет в реальности синий, а не голубой, если кому важно.", "2021-03-03T02:37:19Z", "голубой, прозрачный", "0", 1, 0, 5, "Лопатка силиконовая / лопатка кухонная 27 см", "Osagarri"], "74": ["Взяла несколько разных-все понравились!удобные и крупные!", "2021-03-01T18:39:36Z", "зеленый, прозрачный", "0", 1, 0, 5, "Лопатка силиконовая / лопатка кухонная 27 см", "Osa